import {Item} from "./Item";

export const ItemList = ({tasks,onDeleteTask,onDoneTask}) => {
    return (
        <div className="item-list-container">
            {
                tasks.map((task ,index) => {
                    return <Item key={index} task={task} onDoneTask={onDoneTask} onDeleteTask={onDeleteTask} />
                })
            }
        </div>
    );
}
